Very HQ promo music video. &quot;Dum Dum Girl&quot; is a song from It's My Life, the second studio album by Talk Talk, released in 1984.

It was a Top 5 hit album in several European countries, thanks to the big international success of its singles (notably &quot;Such a Shame&quot;), but it only reached #35 in the UK Top 40 chart. In the US, the album just missed the Top 40, reaching #42.
